                                      <div className="thumbnail">
                                        <img
                                              src={d.img}
                                              alt="..."
                                              className="team-img"
                                          />{' '}
                                      </div>
                                  </div>
                                  <div className="col-xs-10 col-md-10 d-flex">
                                      <h3>{d.title}</h3>
                                  </div>
                                  <div className="col-xs-8 col-md-8 d-flex">
                                  </div>
                              </div>
                          ))
                        : 'Loading...'}
                </div>
            </div>
        </div>
    );
};
